"use strict";
let number = 7;
// Test 1: Equality check
console.log("Is number == 7? I predict True.");
console.log(number == 7);
// Test 2: Inequality check
console.log("Is number != 5? I predict True.");
console.log(number != 5);
// Test 3: Greater than check
console.log("Is number > 5? I predict True.");
console.log(number > 5);
// Test 4: Less than check
console.log("Is number < 10? I predict True.");
console.log(number < 10);
// Test 5: Greater than or equal to check
console.log("Is number >= 7? I predict True.");
console.log(number >= 7);
// Test 6: Less than or equal to check
console.log("Is number <= 6? I predict False.");
console.log(number <= 6);
// Test 7: Logical AND operation
console.log("Is (number > 7) && (number < 10)? I predict False.");
console.log((number > 7) && (number < 10));
// Test 8: Logical OR operation
console.log("Is (number > 10) || (number < 5)? I predict False.");
console.log((number > 10) || (number < 5));
// Test 9: Negation
console.log("Is !(number == 7)? I predict False.");
console.log(!(number == 7));
// Test 10: Combining equality and logical OR
console.log("Is (number == 5) || (number == 8)? I predict False.");
console.log((number == 5) || (number == 7));
